              <text id="The_Filecoin_Foundation_for_the_Decentralized_Web_announced_a_multi-year_commitment_to_The_Starling_Lab_a_new_research_center_tackling_the_technical_and_ethical_challenges_of_establishing_trust_in_the_most_sensitive_digital_records_of_our_human_history._" data-name="The Filecoin Foundation for the Decentralized Web announced a multi-year commitment to The Starling Lab, a new research center tackling the technical and ethical challenges of establishing trust in the most sensitive digital records of our human history.
        " transform="translate(189 2049)" fill="#141414" font-size="18" font-family="Manrope-Medium, Manrope" font-weight="500" letter-spacing="0.02em"><tspan x="0" y="19">The Filecoin Foundation for the </tspan><tspan x="0" y="49">Decentralized Web </tspan><tspan y="49">announced a multi-year </tspan><tspan x="0" y="79">commitment to </tspan><tspan y="79">The Starling Lab</tspan><tspan y="79">, a new </tspan><tspan x="0" y="109">research center tackling the technical and </tspan><tspan x="0" y="139">ethical challenges of establishing trust in </tspan><tspan x="0" y="169">the most sensitive digital records of our </tspan><tspan x="0" y="199">human history. </tspan><tspan x="0" y="247">The $2 million USD long-term donation to </tspan><tspan x="0" y="277">The Starling Lab</tspan><tspan y="277" xml:space="preserve"> will be used to hire full-</tspan><tspan x="0" y="307">time staff and fund fellowships at The Lab, </tspan><tspan x="0" y="337">bringing together faculty, students, and </tspan><tspan x="0" y="367">experts to develop open-source tools, best </tspan><tspan x="0" y="397">practices, and case studies to document </tspan><tspan x="0" y="427">human and civil rights violations, war crimes, </tspan><tspan x="0" y="457">and testimony of genocide.</tspan></text>
            </g>

        status?" transform="translate(209 7399.852)" fill="#fff" font-size="30" font-family="SpaceGrotesk-Medium, Space Grotesk" font-weight="500" letter-spacing="0.02em"><tspan x="0" y="0">What is your non-profit </tspan><tspan x="0" y="45">status?</tspan></text>
            <text id="FFDW_has_applied_for_501_c_3_tax_exempt_private_operating_foundation_status._Maintaining_adherence_to_mission_is_important_from_source_FFDW_to_destination_end_recipient_no_matter_the_type_of_funding_instrument_contract_grant_donation_used_to_pr" data-name="FFDW has applied for 501(c)(3) tax exempt, private operating foundation status. Maintaining adherence to mission is important from source (FFDW) to destination (end recipient), no matter the type of funding instrument (contract, grant, donation) used to pr" transform="translate(209 7478.852)" fill="#fff" font-size="18" font-family="Manrope-Medium, Manrope" font-weight="500" letter-spacing="0.02em"><tspan x="0" y="19">FFDW has applied for 501(c)(3) tax exempt, </tspan><tspan x="0" y="54">private operating foundation status. </tspan><tspan x="0" y="89">Maintaining adherence to mission is important </tspan><tspan x="0" y="124">from source (FFDW) to destination (end </tspan><tspan x="0" y="159">recipient), no matter the type of funding </tspan><tspan x="0" y="194">instrument (contract, grant, donation) used to </tspan><tspan x="0" y="229">provide resources to end recipients. </tspan></text>
            <text id="What_s_the_relationship_between_the_Filecoin_Foundation_for_the_Decentralized_Web_and_the_Filecoin_Foundation_" data-name="What’s the relationship between the Filecoin Foundation for the Decentralized Web and the Filecoin Foundation? " transform="translate(730 7158.352)" fill="#fff" font-size="30" font-family="SpaceGrotesk-Medium, Space Grotesk" font-weight="500" letter-spacing="0.02em"><tspan x="0" y="30">What’s the relationship </tspan><tspan x="0" y="75">between the Filecoin </tspan><tspan x="0" y="120">Foundation for the </tspan><tspan x="0" y="165">Decentralized Web and the </tspan><tspan x="0" y="210">Filecoin Foundation? </tspan></text>
            <text id="The_creators_of_Filecoin_envisioned_an_independent_foundation_that_would_serve_as_the_long-term_governance_body_for_the_Filecoin_ecosystem._Its_original_mandate_was_to_grow_an_open_ecosystem_for_decentralized_storage_and_to_give_developers_an_open_and_s" data-name="The creators of Filecoin envisioned an independent foundation that would serve as the long-term governance body for the Filecoin ecosystem. Its original mandate was to “grow an open ecosystem for decentralized storage” and to “give developers an open and s" transform="translate(730 7407.352)" fill="#fff" font-size="18" font-family="Manrope-Medium, Manrope" font-weight="500" letter-spacing="0.02em"><tspan x="0" y="19">The creators of Filecoin envisioned an </tspan><tspan x="0" y="54">independent foundation that would serve as the </tspan><tspan x="0" y="89">long-term governance body for the Filecoin </tspan><tspan x="0" y="124">ecosystem. Its original mandate was to “grow an </tspan><tspan x="0" y="159">open ecosystem for decentralized storage” and </tspan><tspan x="0" y="194">to “give developers an open and sustainable </tspan><tspan x="0" y="229">platform to build, enhance and monetize those </tspan><tspan x="0" y="264">services.” </tspan><tspan x="0" y="299"></tspan><tspan x="0" y="334">The Filecoin Foundation (FF) is an independent </tspan><tspan x="0" y="369">organization that facilitates governance of the </tspan><tspan x="0" y="404">Filecoin network, funds critical development </tspan><tspan x="0" y="439">projects, supports the growth of the Filecoin </tspan><tspan x="0" y="474">ecosystem, and advocates for Filecoin and the </tspan><tspan x="0" y="509">decentralized web. FF does this by coordinating </tspan><tspan x="0" y="544">and supporting the creation and improvement of </tspan><tspan x="0" y="579">open-source software and open protocols for </tspan><tspan x="0" y="614">decentralized data storage and retrieval </tspan><tspan x="0" y="649">networks. </tspan><tspan x="0" y="684"></tspan><tspan x="0" y="719">The Filecoin Foundation for the Decentralized </tspan><tspan x="0" y="754">Web (FFDW) focuses on charitable activities </tspan><tspan x="0" y="789">related to preserving important datasets, such </tspan><tspan x="0" y="824">as building and supporting the decentralized </tspan><tspan x="0" y="859">web community, funding research and </tspan><tspan x="0" y="894">development, and educating the public about </tspan><tspan x="0" y="929">the decentralized web.</tspan></text>

            <text id="tablet-The_Filecoin_Foundation_for_the_Decentralized_Web_announced_a_multi-year_commitment_to_The_Starling_Lab_a_new_research_center_tackling_the_technical_and_ethical_challenges_of_establishing_trust_in_the_most_sensitive_digital_records_of_our_human_history._" data-name="The Filecoin Foundation for the Decentralized Web announced a multi-year commitment to The Starling Lab, a new research center tackling the technical and ethical challenges of establishing trust in the most sensitive digital records of our human history.
        " transform="translate(739.887 3934.256)" fill="#141414" font-size="18" font-family="Manrope-Medium, Manrope" font-weight="500" letter-spacing="0.02em"><tspan x="0" y="19">The Filecoin Foundation for the </tspan><tspan x="0" y="49">Decentralized Web </tspan><tspan y="49">announced a </tspan><tspan x="0" y="79">multi-year commitment to </tspan><tspan y="79">The </tspan><tspan x="0" y="109">Starling Lab</tspan><tspan y="109">, a new research center </tspan><tspan x="0" y="139">tackling the technical and ethical </tspan><tspan x="0" y="169">challenges of establishing trust in </tspan><tspan x="0" y="199">the most sensitive digital records of </tspan><tspan x="0" y="229">our human history. </tspan><tspan x="0" y="277">The $2 million USD long-term </tspan><tspan x="0" y="307">donation to </tspan><tspan y="307">The Starling Lab</tspan><tspan y="307" xml:space="preserve"> will be </tspan><tspan x="0" y="337">used to hire full-time staff and fund </tspan><tspan x="0" y="367">fellowships at The Lab, bringing </tspan><tspan x="0" y="397">together faculty, students, and </tspan><tspan x="0" y="427">experts to develop open-source </tspan><tspan x="0" y="457">tools, best practices, and case </tspan><tspan x="0" y="487">studies to document human and civil </tspan><tspan x="0" y="517">rights violations, war crimes, and </tspan><tspan x="0" y="547">testimony of genocide.</tspan></text>

            <text id="tablet-What_is_your_non-profit_status_" data-name="What is your non-profit status?" transform="translate(217 7242.13)" fill="#fff" font-size="30" font-family="SpaceGrotesk-Medium, Space Grotesk" font-weight="500" letter-spacing="0.02em"><tspan x="0" y="30">What is your non-profit </tspan><tspan x="0" y="75">status?</tspan></text>
            <text id="tablet-FFDW_has_applied_for_501_c_3_tax_exempt_private_operating_foundation_status._Maintaining_adherence_to_mission_is_important_from_source_FFDW_to_destination_end_recipient_no_matter_the_type_of_funding_instrument_contract_grant_donation_used_to_pr" data-name="FFDW has applied for 501(c)(3) tax exempt, private operating foundation status. Maintaining adherence to mission is important from source (FFDW) to destination (end recipient), no matter the type of funding instrument (contract, grant, donation) used to pr" transform="translate(217 7355.13)" fill="#fff" font-size="18" font-family="Manrope-Medium, Manrope" font-weight="500" letter-spacing="0.02em"><tspan x="0" y="19">FFDW has applied for 501(c)(3) tax </tspan><tspan x="0" y="54">exempt, private operating foundation </tspan><tspan x="0" y="89">status. Maintaining adherence to </tspan><tspan x="0" y="124">mission is important from source (FFDW) </tspan><tspan x="0" y="159">to destination (end recipient), no matter </tspan><tspan x="0" y="194">the type of funding instrument </tspan><tspan x="0" y="229">(contract, grant, donation) used to </tspan><tspan x="0" y="264">provide resources to end recipients. </tspan></text>
            <text id="tablet-What_s_the_relationship_between_the_Filecoin_Foundation_for_the_Decentralized_Web_and_the_Filecoin_Foundation_" data-name="What’s the relationship between the Filecoin Foundation for the Decentralized Web and the Filecoin Foundation? " transform="translate(683 7014.822)" fill="#fff" font-size="30" font-family="SpaceGrotesk-Medium, Space Grotesk" font-weight="500" letter-spacing="0.02em"><tspan x="0" y="30">What’s the relationship </tspan><tspan x="0" y="75">between the Filecoin </tspan><tspan x="0" y="120">Foundation for the </tspan><tspan x="0" y="165">Decentralized Web and </tspan><tspan x="0" y="210">the Filecoin Foundation? </tspan></text>
            <text id="tablet-The_creators_of_Filecoin_envisioned_an_independent_foundation_that_would_serve_as_the_long-term_governance_body_for_the_Filecoin_ecosystem._Its_original_mandate_was_to_grow_an_open_ecosystem_for_decentralized_storage_and_to_give_developers_an_open_and_s" data-name="The creators of Filecoin envisioned an independent foundation that would serve as the long-term governance body for the Filecoin ecosystem. Its original mandate was to “grow an open ecosystem for decentralized storage” and to “give developers an open and s" transform="translate(683 7297.822)" fill="#fff" font-size="18" font-family="Manrope-Medium, Manrope" font-weight="500" letter-spacing="0.02em"><tspan x="0" y="19">The creators of Filecoin envisioned an </tspan><tspan x="0" y="54">independent foundation that would serve </tspan><tspan x="0" y="89">as the long-term governance body for the </tspan><tspan x="0" y="124">Filecoin ecosystem. Its original mandate </tspan><tspan x="0" y="159">was to “grow an open ecosystem for </tspan><tspan x="0" y="194">decentralized storage” and to “give </tspan><tspan x="0" y="229">developers an open and sustainable </tspan><tspan x="0" y="264">platform to build, enhance and monetize </tspan><tspan x="0" y="299">those services.” </tspan><tspan x="0" y="334"></tspan><tspan x="0" y="369">The Filecoin Foundation (FF) is an </tspan><tspan x="0" y="404">independent organization that facilitates </tspan><tspan x="0" y="439">governance of the Filecoin network, funds </tspan><tspan x="0" y="474">critical development projects, supports the </tspan><tspan x="0" y="509">growth of the Filecoin ecosystem, and </tspan><tspan x="0" y="544">advocates for Filecoin and the </tspan><tspan x="0" y="579">decentralized web. FF does this by </tspan><tspan x="0" y="614">coordinating and supporting the creation </tspan><tspan x="0" y="649">and improvement of open-source software </tspan><tspan x="0" y="684">and open protocols for decentralized data </tspan><tspan x="0" y="719">storage and retrieval networks. </tspan><tspan x="0" y="754"></tspan><tspan x="0" y="789">The Filecoin Foundation for the </tspan><tspan x="0" y="824">Decentralized Web (FFDW) focuses on </tspan><tspan x="0" y="859">charitable activities related to preserving </tspan><tspan x="0" y="894">important datasets, such as building and </tspan><tspan x="0" y="929">supporting the decentralized web </tspan><tspan x="0" y="964">community, funding research and </tspan><tspan x="0" y="999">development, and educating the public </tspan><tspan x="0" y="1034">about the decentralized web.</tspan></text>

            <text id="mobile-GRANT_SPOTLIGHT" data-name="GRANT SPOTLIGHT" transform="translate(458.896 2827.156)" fill="#141414" font-size="18" font-family="SpaceGrotesk-Medium, Space Grotesk" font-weight="500" letter-spacing="0.02em"><tspan x="-159.012" y="0">GRANT SPOTLIGHT</tspan></text>
            <text id="mobile-The_Filecoin_Foundation_for_the_Decentralized_Web_announced_a_multi-year_commitment_to_The_Starling_Lab_a_new_research_center_tackling_the_technical_and_ethical_challenges_of_establishing_trust_in_the_most_sensitive_digital_records_of_our_human_history._" data-name="The Filecoin Foundation for the Decentralized Web announced a multi-year commitment to The Starling Lab, a new research center tackling the technical and ethical challenges of establishing trust in the most sensitive digital records of our human history.
        " transform="translate(299.514 2869.745)" fill="#141414" font-size="10" font-family="Manrope-Medium, Manrope" font-weight="500" letter-spacing="0.02em"><tspan x="0" y="11">The Filecoin Foundation for the </tspan><tspan x="0" y="33">Decentralized Web announced a multi-year </tspan><tspan x="0" y="55">commitment to The Starling Lab, a new </tspan><tspan x="0" y="77">research center tackling the technical and </tspan><tspan x="0" y="99">ethical challenges of establishing trust in </tspan><tspan x="0" y="121">the most sensitive digital records of our </tspan><tspan x="0" y="143">human history. </tspan><tspan x="0" y="183">The $2 million USD long-term donation to </tspan><tspan x="0" y="205">The Starling Lab will be used to hire full-time </tspan><tspan x="0" y="227">staff and fund fellowships at The Lab, </tspan><tspan x="0" y="249">bringing together faculty, students, and </tspan><tspan x="0" y="271">experts to develop open-source tools, best </tspan><tspan x="0" y="293">practices, and case studies to document </tspan><tspan x="0" y="315">human and civil rights violations, war </tspan><tspan x="0" y="337">crimes, and testimony of genocide.</tspan></text>

            <text id="mobile-What_s_the_relationship_between_the_Filecoin_Foundation_for_the_Decentralized_Web_and_the_Filecoin_Foundation_" data-name="What’s the relationship between the Filecoin Foundation for the Decentralized Web and the Filecoin Foundation? " transform="translate(220.469 5495.995)" fill="#fff" font-size="18" font-family="SpaceGrotesk-Medium, Space Grotesk" font-weight="500" letter-spacing="0.02em"><tspan x="0" y="18">What’s the relationship between </tspan><tspan x="0" y="45">the Filecoin Foundation for the </tspan><tspan x="0" y="72">Decentralized Web and the </tspan><tspan x="0" y="99">Filecoin Foundation? </tspan></text>
            <text id="mobile-The_creators_of_Filecoin_envisioned_an_independent_foundation_that_would_serve_as_the_long-term_governance_body_for_the_Filecoin_ecosystem._Its_original_mandate_was_to_grow_an_open_ecosystem_for_decentralized_storage_and_to_give_developers_an_open_and_s" data-name="The creators of Filecoin envisioned an independent foundation that would serve as the long-term governance body for the Filecoin ecosystem. Its original mandate was to “grow an open ecosystem for decentralized storage” and to “give developers an open and s" transform="translate(218 5619.868)" fill="#fff" font-size="12" font-family="Manrope-Medium, Manrope" font-weight="500" letter-spacing="0.02em"><tspan x="0" y="13">The creators of Filecoin envisioned an independent </tspan><tspan x="0" y="35">foundation that would serve as the long-term </tspan><tspan x="0" y="57">governance body for the Filecoin ecosystem. Its </tspan><tspan x="0" y="79">original mandate was to “grow an open ecosystem </tspan><tspan x="0" y="101">for decentralized storage” and to “give developers </tspan><tspan x="0" y="123">an open and sustainable platform to build, enhance </tspan><tspan x="0" y="145">and monetize those services.” </tspan><tspan x="0" y="167"></tspan><tspan x="0" y="189">The Filecoin Foundation (FF) is an independent </tspan><tspan x="0" y="211">organization that facilitates governance of the </tspan><tspan x="0" y="233">Filecoin network, funds critical development </tspan><tspan x="0" y="255">projects, supports the growth of the Filecoin </tspan><tspan x="0" y="277">ecosystem, and advocates for Filecoin and the </tspan><tspan x="0" y="299">decentralized web. FF does this by coordinating </tspan><tspan x="0" y="321">and supporting the creation and improvement of </tspan><tspan x="0" y="343">open-source software and open protocols for </tspan><tspan x="0" y="365">decentralized data storage and retrieval networks. </tspan><tspan x="0" y="387"></tspan><tspan x="0" y="409">The Filecoin Foundation for the Decentralized Web </tspan><tspan x="0" y="431">(FFDW) focuses on charitable activities related to </tspan><tspan x="0" y="453">preserving important datasets, such as building </tspan><tspan x="0" y="475">and supporting the decentralized web community, </tspan><tspan x="0" y="497">funding research and development, and educating </tspan><tspan x="0" y="519">the public about the decentralized web.</tspan></text>
            <text id="mobile-_Follow_us_on_social_media_FFDWeb_for_the_latest_updates_from_FFDW_and_open_calls_for_grants_" data-name="* Follow us on social media, @FFDWeb, for the latest updates from FFDW and open calls for grants " transform="translate(293 6296.837)" fill="#fff" font-size="16" font-family="Manrope-Medium, Manrope" font-weight="500" letter-spacing="0.02em"><tspan x="0" y="17">* Follow us on social media, </tspan>
              <a xlink:href="https://twitter.com/ffdweb" target="_blank">
                <tspan x="0" y="41" fill="#37fffe">@FFDWeb</tspan>
              </a>
              <tspan y="41">, for the latest </tspan><tspan x="0" y="65">updates from FFDW and </tspan><tspan x="0" y="89">open calls for grants </tspan>
            </text>

      <style id="inject-styles"></style>

      <script type="text/javascript">
      function autorun() {
        var sections = {
          // Desktop
          'Who_we_are': 'Who_We_Are-4',
          'What_we_do': 'What_We_Do-4',
          'Grants': 'FFDW_Grants-3',
          'FAQs': 'Frequently_Asked_Questions-3',
          'Get_Involved-4': 'Get_Involved-3',
          // Tablet
          'tablet-Who_we_are': 'tablet-Who_we_are-4',
          'tablet-What_we_do': 'tablet-What_We_Do-4',
          'tablet-Grants': 'tablet-FFDW_Grants-3',
          'tablet-FAQs': 'tablet-Frequently_Asked_Questions-3',
          'tablet-Get_Involved': 'tablet-Get_Involved-4',
          // Mobile
          'mobile-Who_we_are': 'mobile-Who_we_are-4',
          'mobile-What_we_do': 'mobile-What_we_do-4',
          'mobile-Grants': 'mobile-FFDW_Grants-3',
          'mobile-FAQs': 'mobile-Frequently_asked_questions-3',
          'mobile-Get_Involved': 'mobile-Get_Involved-4'
        };
        var styleTag = document.querySelector('#inject-styles')
        var styles = ''
        Object.keys(sections).map((buttonId) => {
          var button = document.querySelector(`#${buttonId}`);
          var offset = 50;
          // ---------------------------------------------------------- Link click
          button.addEventListener('click', function () {
            var id = button.id;
            var section = document.querySelector(`#${sections[id]}`);
            if (section) {
              window.scrollTo({
                top: section.getBoundingClientRect().top - offset,
                behavior: 'smooth'
              });
            }
          });
          // ------------------------------------------ Dynamically compile styles
          styles += `
            #${buttonId} {
              cursor: pointer;
            }
            #${buttonId}:hover {
              color: var(--color-aqua);
              fill: var(--color-aqua);
            }
          `;
          // --------- Inject styles into style tag directly above this script tag
          styleTag.innerHTML = styles;
        });
      };
      if (document.addEventListener) document.addEventListener("DOMContentLoaded", autorun, false);
      else if (document.attachEvent) document.attachEvent("onreadystatechange", autorun);
      else window.onload = autorun;
      </script>
